import React from 'react';
import Layout from 'main';

function Pages() {
  return (
      <>
      <Layout />
          <h1>Hello World</h1>
      </>
  );
}

export async function getStaticProps() {
    const res = await fetch("https://api.github.com/orgs/rocketseat/repos")
    const posts = await res.json()
  
    return {
      props: {
        posts,
      },
    }
  }

export default Pages;
